export default transactions => {
  const date = new Date();
  let income = 0;
  let expenses = 0;
  let predictedIncome = 0;
  let predictedExpenses = 0;

  transactions.map(transaction => {
    income = +parseFloat(transaction.amount.replace('.', '').replace(',', '.'));

    console.log(income);

    console.log(date.toUTCString());
    console.log(new Date(transaction.date).toUTCString());
    console.log(date.getTime() < new Date(transaction.date).getTime());
  });
};
